import { Component, OnInit } from '@angular/core';
import { Own } from "./own";

@Component({
  selector: 'app-myown',
  templateUrl: './myown.component.html',
  styleUrls: ['./myown.component.css']
})
export class MyownComponent implements OnInit {

  //constructor() { }

  ngOnInit(): void {
  }

  currentLoggedInUser = "Own Owls";

  //used to demo *ngIf from the HTML oage

  //dealing with images
  imageWidth = 100;
  imageMargin = 2;
  showImage = false;

  //used to demo 2-way binding in the HTML page
  actualInputfield = '';

  get inputField() {
    return this.actualInputfield;
  }
  set inputField(temp: string){
    this.actualInputfield = temp;

    this.filteredPlanets = this.actualInputfield?
            this.performFilter(this.inputField) : this.planets;
            //        true                            false
  }

  planets: Own[];
  filteredPlanets: Own[];

  constructor() {
    this.planets = [
      {
        name: 'Surprised',
        image: 'data:image/jpeg;base64,',
        seen: new Date("05/11/2020 08:30:00"),
        value: 1500
      },
      {
        name: 'Angry',
        image: 'data:image/jpeg;base64,',
        seen: new Date("12/31/2019 08:30:00"),
        value: 20000
      },
      {
        name: 'Normal',
        image: 'https://encrypted-tbn0.gstatic.com/images?q=tbn%3AANd9GcTNKrR5lFwZKBbXaJR7XUFvqfKLq1VR-yHzWv3Hc8WrHOFHjJTt&usqp=CAU',
        seen: new Date("11/22/2016 08:30:00"),
        value: 1000000
      }
    ];

    this.filteredPlanets = this.planets;
   }

   toggleImage(){
     this.showImage = !this.showImage;
   }

   performFilter(filterValue: string): Own[] {
     filterValue = filterValue.toLocaleLowerCase();

     return this.planets.filter(
       (planet: Own) =>
       planet.name.toLocaleLowerCase().indexOf(filterValue)!== -1
     );
   }

}
